const Notification = ({ items, times }) => {
    const rendered_items = items.map((item, time) => {
        return (
            <div>
                <p>{ item }</p>
                <p>{ time }</p>
            </div>
        )
    })

    return (
        <div>{ rendered_items }</div>
    )
}

export default Notification;
